import React from "react";

class Footer extends React.Component{
    render() {
        return(
            <div class="container">
            <footer class="footer" id="footer">
                <h1 class="footer_info">Bottom Text</h1>
            </footer>
            </div>
        );
    }
}
export default Footer;
